local currentFrame = 1
local lastTick = tick()

-- Interval between frame updates (in seconds)
local frameInterval = 0.25

-- Animation loop
local connection
connection = runService.RenderStepped:Connect(function()
	if tick() - lastTick >= frameInterval then
		fpsUpdateEvent:FireServer(frames[currentFrame])
		currentFrame += 1
		lastTick = tick()

		if currentFrame > #frames then
			currentFrame = 1 -- Reset to the first frame for looping
		end
	end
end)
